@Beowulf6666:
If the aspect of the movie follow the standard anamorphic frame aspect (2.39:1), then of course there will be some black bars when showing the movie on a 16:9 TV, unless you stretch the picture vertically. In addition the bitrate and size of the video, is not only dependent on the resolution but also the compression.

Thank you for the movie DownTYU
